import { useEffect, useState } from "react"
import { PokemonEntry } from "../types/pokemons"

export default function Home() {
  const [pokemons, setPokemons] = useState<PokemonEntry[]>([])

  useEffect(() => {
    fetch("https://pokeapi.co/api/v2/pokedex/2/")
      .then((pokemons) => pokemons.json())
      .then((pokemons) => setPokemons(pokemons.pokemon_entries))
  }, [])

  return (
    <div>
      <h1>Pokedex - Bea</h1>
      <ul>
        {pokemons.map((pokemon) => (
          <li key={pokemon.entry_number}>{pokemon.pokemon_species.name}</li>
        ))}
      </ul>
    </div>
  )
}
